import React from 'react'
import Avatar from '@material-ui/core/Avatar';
import Picture from '../../../assests/images/Ray.jpg'
import { makeStyles } from '@material-ui/styles';


const avatar = () => {
    const useStyles = makeStyles({
        avatar: {
          margin: 10,
        },
        bigAvatar: {
          margin: 10,
          width: 60,
          height: 60,
        },
      });

    const classes = useStyles;
    return (
        <div>
            <Avatar alt="Ricky ProfPic" src={Picture} className={useStyles.bigAvatar} ></Avatar>
        </div>
    )
}

export default avatar
